    def moveZerosOptimal(self, nums):
        if not nums:return nums

        nextPtr = 0

        for num in nums:
            if num != 0:
                nums[nextPtr] = num
                nextPtr += 1

        for i in range(nextPtr, len(nums)):
            nums[i] = 0

        return nums

